/** * Created by mingkunyu on 2019-08-31 */import java.util.Stack;public class Solution_5 {    Stack<Integer> stack1 = new Stack<Integer>();    Stack<Integer> stack2 = new Stack<Integer>();    /**     *  队尾添加元素     * @param node     */    public  void push(int node) {        stack1.push(node);    }    /**     * 队头获取数据     * @return     */     public int pop() {         if (stack2.isEmpty()){             while (!stack1.isEmpty()){                 stack2.add(stack1.pop());             }         }        return stack2.pop();    }}